                                },
                                ["events"] = "NSAPI_ENCOUNTER_START UNIT_SPELLCAST_START:boss1 NS_CHECK_COMBO",
                                ["custom"] = "function(s, e, ...)\
           if e == \"OPTIONS\" then\
               \
               local available = {\
                   [1] = true,\
                   [2] = true,\
                   [4] = true,\
               }\
               for i=1,6 do\
                   s[i] = {\
                       show = true,\
                       changed = true,\
                       progressType = \"static\",\
                       icon = C_Spell.GetSpellInfo(aura_env.icons[i]).iconID,\
                       text1 = aura_env.texts1[i],\
                       text2 = aura_env.texts2[i],\
                       left = aura_env.left[i],\
                       available = available[aura_env.left[i]] and available[aura_env.right[i]],\
                       right = aura_env.right[i],\
                       num = i,\
                       index = aura_env.index[i] or false,\
                       value = 0,\
                       total = 100,                \
                       additionalProgress ={\
                           { \
                               direction = \"forward\",\
                               width = 50,\
                               offset = 0,\
                           },\
                           { \
                               direction = \"forward\",\
                               width = 50,\
                               offset = 50,\
                           }\
                       },\
                       autoHide = true,\
                   }\
                   \
               end\
               return true\
           elseif e == \"NS_CHECK_COMBO\" and ... then\
               local available = {}\
               local unitsG = {}\
               local units = {}\
               local current = 0\
               local num = 0\
               for i=1, 6 do\
                   if s[i] and s[i].show and s[i].available then\
                       if current == 0 or s[i].index < current then\
                           current = s[i].index -- storing the first available combo from the list\
                           num = i\
                       end\
                   end\
               end\
               for i=2, 6 do -- skipp boss1 but check further than 4 for adds that were kept alive last wave\
                   local u = \"boss\"..i\
                   if UnitExists(u) then \
                       local G = UnitGUID(u)\
                       for j, v in ipairs(aura_env.buffs) do\
                           if WA_GetUnitBuff(u, aura_env.buffs[j]) then\
                               available[j] = true\
                               table.insert(units, u)\
                               break\
                           end \
                       end\
                       if (WA_GetUnitBuff(u, s[num].left) or WA_GetUnitBuff(u, s[num].right)) then\
                           aura_env.GUIDS[G] = true\
                           unitsG[G] = true\
                           table.insert(units, u)\
                       elseif WA_GetUnitBuff(u, aura_env.shielded) and not aura_env.GUIDS[G] then\
                           aura_env.GUIDS[G] = true\
                           WeakAuras.ScanEvents(\"NS_AUTOMARK_3RD\", u) \
                       end\
                   end\
               end            \
               WeakAuras.ScanEvents(\"NS_BANDIT_NAMEPLATE\", unitsG)\
               WeakAuras.ScanEvents(\"NS_BANDIT_AUTOMARK\", units)\
               for i=1, 6 do\
                   if s[i] then\
                       s[i].available = available[aura_env.left[i]] and available[aura_env.right[i]]\
                       s[i].changed = true\
                   end\
               end\
               return true\
               \
           elseif e == \"UNIT_SPELLCAST_SUCCEEDED\" then\
               local u, cast, spellID = ... -- Unit event\
               if spellID == aura_env.spin then\
                   C_Timer.After(0.5, function()\
                           WeakAuras.ScanEvents(\"NS_CHECK_COMBO\", true)\
                   end)\
               elseif aura_env.spells[spellID] then\
                   for i=1, 6 do\
                       if s[i] and s[i].available then\
                           s[i].available = false\
                           s[i].changed = true\
                       end\
                   end\
                   return true\
               end\
               \
               \
           elseif e == \"NSAPI_ENCOUNTER_START\" then\
               aura_env.MRT()\
               aura_env.GUIDS = {}\
               for i=1, 6 do\
                   s[i] = {\
                       show = true,\
                       changed = true,\
                       progressType = \"static\",\
                       icon = C_Spell.GetSpellInfo(aura_env.icons[i]).iconID,\
                       text1 = aura_env.texts1[i],\
                       text2 = aura_env.texts2[i],\
                       left = aura_env.left[i],\
                       right = aura_env.right[i],\
                       available = false,\
                       num = i,\
                       index = aura_env.index[i],\
                       value = 0,\
                       total = 100,                \
                       additionalProgress ={\
                           { \
                               direction = \"forward\",\
                               width = 50,\
                               offset = 0,\
                           },\
                           { \
                               direction = \"forward\",\
                               width = 50,\
                               offset = 50,\
                           }\
                       },\
                       autoHide = true,\
                   }\
               end\
               return true\
           elseif e == \"UNIT_SPELLCAST_START\" then\
               local u, cast, spellID = ... -- Unit event\
               if spellID == aura_env.transition then\
                   for _, v in pairs(s) do\
                       v.show = false\
                       v.changed = true\
                   end\
                   return true\
               else\
                   local i = aura_env.spells[spellID]\
                   if i and s[i] then\
                       s[i].show = false\
                       s[i].changed = true\
                       return true\
                   end\
               end\
           end\
       end\
       \
